// hashing algo for passwords, from https://geraintluff.github.io/sha256/
function sha256(ascii) {
    function rightRotate(value, amount) {
        return (value >>> amount) | (value << (32 - amount));
    };
    var mathPow = Math.pow;
    var maxWord = mathPow(2, 32);
    var lengthProperty = 'length'
    var i, j;
    var result = ''
    var words = [];
    var asciiBitLength = ascii[lengthProperty] * 8;
    var hash = [], k = [];
    var primeCounter = 0;
    var isComposite = {};
    for (var candidate = 2; primeCounter < 64; candidate++) {
        if (!isComposite[candidate]) {
            for (i = 0; i < 313; i += candidate) {
                isComposite[i] = candidate;
            }
            hash[primeCounter] = (mathPow(candidate, .5) * maxWord) | 0;
            k[primeCounter++] = (mathPow(candidate, 1 / 3) * maxWord) | 0;
        }
    }
    ascii += '\x80'
    while (ascii[lengthProperty] % 64 - 56) ascii += '\x00'
    for (i = 0; i < ascii[lengthProperty]; i++) {
        j = ascii.charCodeAt(i);
        if (j >> 8) return;
        words[i >> 2] |= j << ((3 - i) % 4) * 8;
    }
    words[words[lengthProperty]] = ((asciiBitLength / maxWord) | 0);
    words[words[lengthProperty]] = (asciiBitLength)
    for (j = 0; j < words[lengthProperty];) {
        var w = words.slice(j, j += 16);
        var oldHash = hash;
        hash = hash.slice(0, 8);
        for (i = 0; i < 64; i++) {
            var i2 = i + j;
            var w15 = w[i - 15], w2 = w[i - 2];
            var a = hash[0], e = hash[4];
            var temp1 = hash[7]
                + (rightRotate(e, 6) ^ rightRotate(e, 11) ^ rightRotate(e, 25)) // S1
                + ((e & hash[5]) ^ ((~e) & hash[6])) // ch
                + k[i]
                + (w[i] = (i < 16) ? w[i] : (
                    w[i - 16]
                    + (rightRotate(w15, 7) ^ rightRotate(w15, 18) ^ (w15 >>> 3)) // s0
                    + w[i - 7]
                    + (rightRotate(w2, 17) ^ rightRotate(w2, 19) ^ (w2 >>> 10)) // s1
                ) | 0
                );
            var temp2 = (rightRotate(a, 2) ^ rightRotate(a, 13) ^ rightRotate(a, 22)) // S0
                + ((a & hash[1]) ^ (a & hash[2]) ^ (hash[1] & hash[2])); // maj

            hash = [(temp1 + temp2) | 0].concat(hash);
            hash[4] = (hash[4] + temp1) | 0;
        }
        for (i = 0; i < 8; i++) {
            hash[i] = (hash[i] + oldHash[i]) | 0;
        }
    }
    for (i = 0; i < 8; i++) {
        for (j = 3; j + 1; j--) {
            var b = (hash[i] >> (j * 8)) & 255;
            result += ((b < 16) ? 0 : '') + b.toString(16);
        }
    }
    return result;
};

// setting Access-Control-Allow-Origin, i.e. who can ask for maze data
app.use(function (req, res, next) {
    res.setHeader("Access-Control-Allow-Origin", "*");
    next();
});

// if url ends in '/get-maze', server will return the current maze data
app.get('/get-maze', (req, res) => {
    res.setHeader('Content-Type', 'application/json');
    res.write(JSON.stringify(maze_data));
    res.status(200);
    res.end();
})

// if url ends in '/listen-for-maze', server will return new maze data when it receives it, times out after 12 hours
app.get('/listen-for-maze', (req, res) => {
    old_maze_number = maze_number
    setTimeout(checkForUpdates, 1000)
    function checkForUpdates() {
        if (old_maze_number == maze_number) {
            setTimeout(checkForUpdates, 1000)
        } else {
            res.setHeader('Content-Type', 'application/json');
            res.write(JSON.stringify(maze_data));
            res.status(200);
            res.end();
        }
    }
})

// if url is root (i.e. ends in '/'), server will try to update the maze, pswrd and maze must be provided, like this:
// 'http://localhost:3000?password=[password]&maze=[maze]', where password = str and maze = {}
app.get('/', (req, res) => {
    res.setHeader('Content-Type', 'text/plain');

    if (Object.keys(req.query).length == 2) {
        if (sha256(req.query.password) == '5e884898da28047151d0e56f8dc6292773603d0d6aabbdd62a11ef721d1542d8') {
            // 9fc0e33c3844162ab66cde683f29d6da851aa6ede83fbf1217d598f7391a95f9

            maze_data = req.query.maze; // get original query as string
            maze_data = maze_data.replaceAll("%2522", '"').replaceAll("%22", '"'); // decode ASCII encoding
            maze_data = JSON.parse(maze_data); // parse the string into an [Object object]
            maze_number += 1

            res.status(201); // created!
            res.end('Maze updated to:\n\n' + JSON.stringify(maze_data)); // output stringified Object
        }
        else {
            res.status(403); // forbidden
            res.end('Forbidden.')
        }
    }
    else if (Object.keys(req.query).length == 1) {
        try {
            x = req.query.password
        } catch {
            res.status(403); // forbidden
            res.end('Forbidden.')
        }
        try {
            x = req.query.maze
        } catch {
            res.status(404); // not found
            res.end('Maze not provided.')
        }
    }
    else {
        res.status(403); // forbidden
        res.end('Forbidden.')
    }

})

// run app, i.e. listen for reqs on port PORT
app.listen(PORT, () => {
    console.log(`listening at http://localhost:${PORT}`)
}).setTimeout(12 * 60 * 60 * 1000) // times out after 12 hours